import React from "react";
import Foot from "../../assets/images/Foot.png";
import logo5 from "../../assets/images/foodie-logo-zip-file/png/logo5.png";

export default function Footer() {
  return (
    <div className="bg-black mt-20 relative ">
      <div className="w-full  ">
        <img src={Foot} alt="footer " className="w-full  h-250px  brightness-50" />
      </div>
      <div className="">
        <div className="absolute top-1/2 left-px  h-50px ">
                <img src={logo5} alt="" className="h-1/2 w-full " />
        </div>
      </div>
    </div>
  );
}
